@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.scss']
})
export class HeaderComponent implements OnInit {

  constructor() { }

  ngOnInit(): void {
  }

}
<div class="header">
  <img src="https://www.gpgcheckout.com/img/logo_gpg_paiement.png" style="width: 30px; height: 60px;" alt="Logo">



  <div class="user">
    <div class="user-name">Surender</div>
    <div class="user-image">SN</div>
  </div>
</div>
